import React, { Fragment } from "react";

const Navigation = ({onRouteChange, State} ) => {
    return (
        <nav style={{display: 'flex', justifyContent:'flex-end'}}>
            {                 
                State === 'signout' 
                ?<p onClick={() => onRouteChange('home')} className='f3 link dim blank underline pa3 pointer'>
                 Sign Out
                 </p>
                :
                <Fragment>
                    <p onClick={() => onRouteChange('signin')} className='f3 link dim blank underline pa3 pointer'>
                    Sign In
                    </p>
                    <p onClick={() => onRouteChange('register')} className='f3 link dim blank underline pa3 pointer'>
                    Register
                    </p>
                </Fragment>
                }
            
        </nav>
    );
}

export default Navigation;
